accordion/documentation.html.body:
Accordion Documentation
Usage
    &lt;sc-accordion&gt;

        &lt;sc-accordion-item&gt;
            &lt;trigger&gt;My first item&lt;/trigger&gt;
            &lt;content&gt;
                &lt;p&gt;My content&lt;/p&gt;
                &lt;button&gt;Click me&lt;/button&gt;
            &lt;/content&gt;
        &lt;/sc-accordion-item&gt;

         &lt;sc-accordion-item&gt;
            &lt;trigger&gt;My second item&lt;/trigger&gt;
            &lt;content&gt;
                &lt;p&gt;My second content&lt;/p&gt;
            &lt;/content&gt;
        &lt;/sc-accordion-item&gt;

    &lt;/sc-accordion&gt;

&lt;sc-accordion&gt; is the parent element that will coordinate the accordion items. On item open, all the other accordions item with the same parent will be hidden.
&lt;sc-accordion-item&gt; is an item. It contains &lt;trigger&gt; and &lt;content&gt; elements.
Inputs



Name
Type
Element
Default
Description




default
boolean
sc-accordion-item
false
If the item is the default item, it will be opened on component creation.



Outputs



Name
Type
Element
Description




on-open
function
sc-accordion-item
Callback triggered on details open



Transclusion
`&lt;trigger&gt; will be transcluded into the displayed part. On click, its details is toggled.
`&lt;content&gt; will be transcluded into the details part.
Style customisation



Name
Default
Description




$sc-accordion-background
$discrete-light
Defines the background color of the accordion details

dropdown-menu/documentation.html.body:
Dropdown menu Documentation
Usage
    &lt;sc-dropdown-menu&gt;
        &lt;sc-dropdown-menu-trigger&gt;
            &lt;i class=&quot;sc-dropdown-menu-icon&quot;&gt;Your icon&lt;/i&gt;
            &lt;span class=&quot;sc-user-menu-text&quot;&gt;Username&lt;/span&gt;
        &lt;/sc-dropdown-menu-trigger&gt;
        &lt;sc-dropdown-menu-dropdown&gt;
            &lt;ul&gt;
                &lt;li&gt;
                    &lt;span class=&quot;sc-dropdown-menu-item-label&quot;&gt;Do nothing&lt;/span&gt;
                &lt;/li&gt;
                &lt;li ng-click=&quot;ctrl.logout()&quot;&gt;
                    &lt;i class=&quot;sc-dropdown-menu-item-icon&quot;&gt;Your icon&lt;/i&gt;
                    &lt;span class=&quot;sc-dropdown-menu-item-label&quot;&gt;Logout&lt;/span&gt;
                &lt;/li&gt;
            &lt;/ul&gt;
        &lt;/sc-dropdown-menu-dropdown&gt;
    &lt;/sc-dropdown-menu&gt;

&lt;sc-dropdown-menu&gt; contains a trigger part (&lt;sc-dropdown-menu-trigger&gt;) and a dropdown part &lt;sc-dropdown-menu-dropdown&gt;
.sc-dropdown-menu-icon The trigger icon
.sc-dropdown-menu-text The text to display in trigger part
.sc-dropdown-menu-item-icon The menu item icon
.sc-dropdown-menu-item-label The menu item label
Inputs
No input
Outputs
No output
Transclusion
 `&lt;sc-dropdown-menu-trigger&gt; will be transcluded into the displayed part. It is used as trigger part, since it reveals the dropdown on click.
 `&lt;sc-dropdown-menu-dropdown&gt; will be transcluded into the dropdown menu part.
